// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";


export default class Navbar extends Component {

  render() {
    const header = {
      "padding": "0em 0px 0px 2em",
      "font-size": "30px"
    }
    return (
        <nav class="navbar navbar-expand-lg  bg-light">
        <div class="container-fluid">
        <h3>
          Ranking The Best NBA Players  
        <small class="text-muted"> Select Who You Think Is The best</small>
        </h3>

            <ul style={{"padding": "0em 0px 0px 2em"}} class="navbar-nav me-auto mb-2 mb-lg-0">
              <NavLink style={{"font-size": "25px"}}  to="/" className="navbar-brand">Vote</NavLink>
              <NavLink style={{"font-size": "25px"}}  to="/rankings" className="navbar-brand">Rankings</NavLink>  
            </ul>
            
          </div>
        </nav>



    );
  }
}
